import { createContext } from "react";
import type { Work } from "./useFetch";

interface SomeContextValue {
  details?: {
    name: string;
    age: Date;
    city: string;
    email: string;
    github: string;
    linkedin: string;
    image: string[];
  };
  misc?: {
    bio: string;
    description: string[];
    important: string;
    skills: string[];
  };
  work?: Work[];
}

export const SomeContext = createContext<SomeContextValue | null>(null);
